  [],\n\t\"title\": \"A Surficial Hydrogeologic Framework for the Mid-Atlantic Coastal
  Plain.\",\n\t\"tracking_summary\": {\n\t\t\"total\": 31,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
