  \"a-surficial-hydrogeologic-framework-for-the-mid-atlantic-coastal-plain\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The hydrogeologic framework was developed
  from a combination of the physiography and the predominant texture of surficial
  geologic units in the Mid-Atlantic Coastal Plain. It describes the primary natural
  physical factors that affect the flow and chemistry of shallow ground water and
  small streams in the Mid-Atlantic Coastal Plain. Seven hydrogeologic subregions
  were defined. Some of the subregions correspond directly to the physiographic subprovinces
  of the region; others were generalized within subprovinces based on sediment texture.
  For more information, see U. S. Geological Survey Professional Paper 1680.\",\n\t\"license_title\":
